import React from "react";

function About() {
    return (
        <div className="container">
            <div class="jumbotron">
                <h1 class="display-4">Hello, world!</h1>
                <p class="lead">Meet New Puppies!</p>
                <hr class="my-4"></hr>
                <p>Match and find new Puppies to meet and interact with!</p>
            </div>
            <div>
                <h1>Welcome To Pupster!</h1>
            </div>
        </div>
    );
}

export default About;
